create_endpoint(
    docs=u'For more information on return value see `official API docs <http://docs.themoviedb.apiary.io/#get-%2F3%2Fmovie%2F%7Bid%7D%2Freviews>`_\n\nFor information about possible exceptions see :mod:`tmdb.errors` documentation.\n\n\n**Required**\n\n:param int id: \n\n**Optional**\n\n:param str append_to_response: Comma separated, any movie method\n:param int page: Minimum 1, maximum 1000.\n:param str language: ISO 639-1 code.\n\nUsage:\n    >>> api = tmdb.API(api_key)\n    >>> api.movie_reviews(<parameters>)\n    {u\'id\': 49026,\n     u\'page\': 1,\n     u\'results\': [{u\'author\': u\'Travis Bell\',\n                   u\'content\': u"I felt like this was a tremendous end to Nolan\'s Batman trilogy. The Dark Knight Rises may very well have been the weakest of all 3 films but when you\'re talking about a scale of this magnitude, it still makes this one of the best movies I\'ve seen in the past few years.\\r\\n\\r\\nI expected a little more _Batman_ than we got (especially with a runtime of 2:45) but while the story around the fall of Bruce Wayne and Gotham City was good I didn\'t find it amazing. This might be in fact, one of my only criticisms\\u2014it was a long movie but still, maybe too short for the story I felt was really being told. I feel confident in saying this big of a story could have been split into two movies.\\r\\n\\r\\nThe acting, editing, pacing, soundtrack and overall theme were the same \'as-close-to-perfect\' as ever with any of Christopher Nolan\'s other films. Man does this guy know how to make a movie!\\r\\n\\r\\nYou don\'t have to be a Batman fan to enjoy these movies and I hope any of you who feel this way re-consider. These 3 movies are without a doubt in my mind, the finest display of comic mythology ever told on the big screen. They are damn near perfect.",\n                   u\'id\': u\'5010553819c2952d1b000451\',\n                   u\'url\': u\'http://j.mp/QSjAK2\'},\n                  {u\'author\': u\'Chris\',\n                   u\'content\': u"I personally thought this film is on par if not better than the Dark Knight.\\r\\n\\r\\nWhilst some think the film is too long for the story I didn\'t find this. The length of the film is longer than some (but doesn\'t feel it), I liked that the film took it\'s time rather than shoving more elements in it - I think this contributed to the dramatic ending (much like a classical piece of music will be relaxed and calm before the final crescendo).\\r\\n\\r\\nAt the end of the day whether you like this film will boil down to if you like films Christopher Nolan has directed and/or you like the Christopher Nolan Batman series so far.\\r\\n\\r\\nStupendously good film in my opinion.",\n                   u\'id\': u\'5013bc76760ee372cb00253e\',\n                   u\'url\': u\'http://j.mp/P18dg1\'},\n                  {u\'author\': u\'GeekMasher\',\n                   u\'content\': u\'The Dark Knight Rises is one of the best movies to come out in 2012. The story compels you to watch it time and time again. It also has I of, I my opinion, the best bad guys in any movie, Bane! Batman was well played as all ways and the cast where well selected. I think this movie is the best batman to see the light of day or the darkest nights (pun intended).\',\n                   u\'id\': u\'51429a7519c29552e10eba16\',\n                   u\'url\': u\'http://j.mp/19nyIWg\'}],\n     u\'total_pages\': 1,\n     u\'total_results\': 3}\n    \n',
    url=u'/3/movie/{id}/reviews',
    class_name=u'MovieReviews',
    method_name=u'movie_reviews',
    schema=schema({u'total_results': 3, u'total_pages': 1, u'results': [{u'content': u"I felt like this was a tremendous end to Nolan's Batman trilogy. The Dark Knight Rises may very well have been the weakest of all 3 films but when you're talking about a scale of this magnitude, it still makes this one of the best movies I've seen in the past few years.\r\n\r\nI expected a little more _Batman_ than we got (especially with a runtime of 2:45) but while the story around the fall of Bruce Wayne and Gotham City was good I didn't find it amazing. This might be in fact, one of my only criticisms\u2014it was a long movie but still, maybe too short for the story I felt was really being told. I feel confident in saying this big of a story could have been split into two movies.\r\n\r\nThe acting, editing, pacing, soundtrack and overall theme were the same 'as-close-to-perfect' as ever with any of Christopher Nolan's other films. Man does this guy know how to make a movie!\r\n\r\nYou don't have to be a Batman fan to enjoy these movies and I hope any of you who feel this way re-consider. These 3 movies are without a doubt in my mind, the finest display of comic mythology ever told on the big screen. They are damn near perfect.", u'url': u'http://j.mp/QSjAK2', u'id': u'5010553819c2952d1b000451', u'author': u'Travis Bell'}, {u'content': u"I personally thought this film is on par if not better than the Dark Knight.\r\n\r\nWhilst some think the film is too long for the story I didn't find this. The length of the film is longer than some (but doesn't feel it), I liked that the film took it's time rather than shoving more elements in it - I think this contributed to the dramatic ending (much like a classical piece of music will be relaxed and calm before the final crescendo).\r\n\r\nAt the end of the day whether you like this film will boil down to if you like films Christopher Nolan has directed and/or you like the Christopher Nolan Batman series so far.\r\n\r\nStupendously good film in my opinion.", u'url': u'http://j.mp/P18dg1', u'id': u'5013bc76760ee372cb00253e', u'author': u'Chris'}, {u'content': u'The Dark Knight Rises is one of the best movies to come out in 2012. The story compels you to watch it time and time again. It also has I of, I my opinion, the best bad guys in any movie, Bane! Batman was well played as all ways and the cast where well selected. I think this movie is the best batman to see the light of day or the darkest nights (pun intended).', u'url': u'http://j.mp/19nyIWg', u'id': u'51429a7519c29552e10eba16', u'author': u'GeekMasher'}], u'id': 49026, u'page': 1}),
    parameters={u'required': {u'id': int}, u'optional': {u'append_to_response': str, u'page': int, u'language': str}, u'order': [u'id']},
)

