create_endpoint(
    docs=u'For more information on return value see `official API docs <http://docs.themoviedb.apiary.io/#get-%2F3%2Fperson%2F%7Bid%7D>`_\n\nFor information about possible exceptions see :mod:`tmdb.errors` documentation.\n\n\n**Required**\n\n:param int id: \n\n**Optional**\n\n:param str append_to_response: Comma separated, any person method\n\nUsage:\n    >>> api = tmdb.API(api_key)\n    >>> api.person(<parameters>)\n    {u\'adult\': False,\n     u\'also_known_as\': [],\n     u\'biography\': u\'From Wikipedia, the free encyclopedia.\\n\\nWilliam Bradley "Brad" Pitt (born December 18, 1963) is an American actor and film producer. Pitt has received two Academy Award nominations and four Golden Globe Award nominations, winning one. He has been described as one of the world\\\'s most attractive men, a label for which he has received substantial media attention.\\n\\nPitt began his acting career with television guest appearances, including a role on the CBS prime-time soap opera Dallas in 1987. He later gained recognition as the cowboy hitchhiker who seduces Geena Davis\\\'s character in the 1991 road movie Thelma & Louise. Pitt\\\'s first leading roles in big-budget productions came with A River Runs Through It (1992) and Interview with the Vampire (1994). He was cast opposite Anthony Hopkins in the 1994 drama Legends of the Fall, which earned him his first Golden Globe nomination. In 1995 he gave critically acclaimed performances in the crime thriller Seven and the science fiction film 12 Monkeys, the latter securing him a Golden Globe Award for Best Supporting Actor and an Academy Award nomination. Four years later, in 1999, Pitt starred in the cult hit Fight Club. He then starred in the major international hit as Rusty Ryan in Ocean\\\'s Eleven (2001) and its sequels, Ocean\\\'s Twelve (2004) and Ocean\\\'s Thirteen (2007). His greatest commercial successes have been Troy (2004) and Mr. & Mrs. Smith (2005). Pitt received his second Academy Award nomination for his title role performance in the 2008 film The Curious Case of Benjamin Button.\\n\\nFollowing a high-profile relationship with actress Gwyneth Paltrow, Pitt was married to actress Jennifer Aniston for five years. Pitt lives with actress Angelina Jolie in a relationship that has generated wide publicity. He and Jolie have six children\\u2014Maddox, Pax, Zahara, Shiloh, Knox, and Vivienne. Since beginning his relationship with Jolie, he has become increasingly involved in social issues both in the United States and internationally. Pitt owns a production company named Plan B Entertainment, whose productions include the 2007 Academy Award winning Best Picture, The Departed.\\n\\nDescription above from the Wikipedia article Brad Pitt, licensed under CC-BY-SA, full list of contributors on Wikipedia.\',\n     u\'birthday\': u\'1963-12-18\',\n     u\'deathday\': u\'\',\n     u\'homepage\': u\'http://simplybrad.com/\',\n     u\'id\': 287,\n     u\'name\': u\'Brad Pitt\',\n     u\'place_of_birth\': u\'Shawnee, Oklahoma, United States\',\n     u\'profile_path\': u\'/w8zJQuN7tzlm6FY9mfGKihxp3Cb.jpg\'}\n    \n',
    url=u'/3/person/{id}',
    class_name=u'Person',
    method_name=u'person',
    schema=schema({u'name': u'Brad Pitt', u'birthday': u'1963-12-18', u'adult': False, u'place_of_birth': u'Shawnee, Oklahoma, United States', u'deathday': u'', u'profile_path': u'/w8zJQuN7tzlm6FY9mfGKihxp3Cb.jpg', u'homepage': u'http://simplybrad.com/', u'id': 287, u'biography': u'From Wikipedia, the free encyclopedia.\n\nWilliam Bradley "Brad" Pitt (born December 18, 1963) is an American actor and film producer. Pitt has received two Academy Award nominations and four Golden Globe Award nominations, winning one. He has been described as one of the world\'s most attractive men, a label for which he has received substantial media attention.\n\nPitt began his acting career with television guest appearances, including a role on the CBS prime-time soap opera Dallas in 1987. He later gained recognition as the cowboy hitchhiker who seduces Geena Davis\'s character in the 1991 road movie Thelma & Louise. Pitt\'s first leading roles in big-budget productions came with A River Runs Through It (1992) and Interview with the Vampire (1994). He was cast opposite Anthony Hopkins in the 1994 drama Legends of the Fall, which earned him his first Golden Globe nomination. In 1995 he gave critically acclaimed performances in the crime thriller Seven and the science fiction film 12 Monkeys, the latter securing him a Golden Globe Award for Best Supporting Actor and an Academy Award nomination. Four years later, in 1999, Pitt starred in the cult hit Fight Club. He then starred in the major international hit as Rusty Ryan in Ocean\'s Eleven (2001) and its sequels, Ocean\'s Twelve (2004) and Ocean\'s Thirteen (2007). His greatest commercial successes have been Troy (2004) and Mr. & Mrs. Smith (2005). Pitt received his second Academy Award nomination for his title role performance in the 2008 film The Curious Case of Benjamin Button.\n\nFollowing a high-profile relationship with actress Gwyneth Paltrow, Pitt was married to actress Jennifer Aniston for five years. Pitt lives with actress Angelina Jolie in a relationship that has generated wide publicity. He and Jolie have six children\u2014Maddox, Pax, Zahara, Shiloh, Knox, and Vivienne. Since beginning his relationship with Jolie, he has become increasingly involved in social issues both in the United States and internationally. Pitt owns a production company named Plan B Entertainment, whose productions include the 2007 Academy Award winning Best Picture, The Departed.\n\nDescription above from the Wikipedia article Brad Pitt, licensed under CC-BY-SA, full list of contributors on Wikipedia.', u'also_known_as': []}),
    parameters={u'required': {u'id': int}, u'optional': {u'append_to_response': str}, u'order': [u'id']},
)

